import { Box } from "grommet";
import React from "react";
import Layout from "../components/Layout";
const propTypes = {};

const defaultProps = {};

export default function index() {
  return (
    <Layout>
      <section className="flex  vh-100 w-100">
        <aside className="title">
          <h1 className="ph4">Agenda</h1>
        </aside>
        <div className="flex-grow-1 w-100 flex flex-column">
          <Box className="h3 item1" align="start" justify="center">
            agenda items
          </Box>
          <Box className="h3 item2 pointer" align="start" justify="center">
            + add item
          </Box>
        </div>
      </section>
      <style jsx>
        {`
          .item1 {
            background-color: #fdfce7;
          }
          .item2 {
            background-color: #faf4c0;
          }

          .title {
            writing-mode: vertical-rl;
            transform: rotate(180deg);
            text-align: center;
            font-size: 4rem;
            text-transform: uppercase;

            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 23px;
            font-style: normal;
            font-variant: normal;
            font-weight: 700;
            line-height: 23px;
            color: #363d87;
          }
        `}
      </style>
    </Layout>
  );
}

index.propTypes = propTypes;
index.defaultProps = defaultProps;
